(4, 1, 1, 'About us', '', 'Learn more about us', 'about us, informations', '<p class=\"au au-title\" style=\"text-align:center;\"><span style=\"color:#b20f0f;\">Bella</span> is an famous which designs, manufactures and markets women’s, men’s, Kid’s clothing and accessories.</p>\r\n<p class=\"au au-desc\" style=\"text-align:center;\"><span style=\"color:#8f8f8f;\">You think water moves fast? You should see ice. It moves like it has a mind. Like it knows it killed the world once and got a taste for murder. After the avalanche, it took us a week to climb out. Now, I don\'t know exactly when we turned on each other, but I know that seven of us survived the slide... It moves like it has a mind. Like it knows it killed the world once and got a taste for murder. After the avalanche, it took us and only five made.</span></p>\r\n<div class=\"au-brand\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-2 col-md-2 col-sm-4 col-sx-12\"><img src=\"themes/jms_mella/assets/img/brands/1.png\" alt=\"\" /></div>\r\n<div class=\"col-lg-2 col-md-2 col-sm-4 col-sx-12\"><img src=\"themes/jms_mella/assets/img/brands/2.png\" alt=\"\" /></div>\r\n<div class=\"col-lg-2 col-md-2 col-sm-4 col-sx-12\"><img src=\"themes/jms_mella/assets/img/brands/3.png\" alt=\"\" /></div>\r\n<div class=\"col-lg-2 col-md-2 col-sm-4 col-sx-12\"><img src=\"themes/jms_mella/assets/img/brands/4.png\" alt=\"\" /></div>\r\n<div class=\"col-lg-2 col-md-2 col-sm-4 col-sx-12\"><img src=\"themes/jms_mella/assets/img/brands/5.png\" alt=\"\" /></div>\r\n<div class=\"col-lg-2 col-md-2 col-sm-4 col-sx-12\"><img src=\"themes/jms_mella/assets/img/brands/6.png\" alt=\"\" /></div>\r\n</div>\r\n</div>\r\n<p class=\"au-video text-center\"><a href=\"https://www.youtube.com/watch?v=7e90gBu4pas\" target=\"_blank\" rel=\"noreferrer noopener\"><img src=\"themes/jms_mella/assets/img/h11-bg-video.jpg\" alt=\"h11-bg-video.jpg\" style=\"margin-left:auto;margin-right:auto;\" /></a></p>\r\n<div class=\"au au-testimonial-body\">\r\n<p><img src=\"